import './styles/App.scss';
import {UserLayout} from './components/UserLayout'
import {ItemListContainer} from './components/ItemListContainer'
import {Products} from './components/Products'

function App() {
  return (
    <div className="App">
      <UserLayout>      
      <div><Products /></div>
      </UserLayout>
    </div>
  );
}

export default App;
